import React, {Component} from 'react';
import './css/main.css';
import './css/util.css';
import './signup.css';
import Sketch from "react-p5";
import { Link, Redirect } from 'react-router-dom';

const axios = require('axios');
let video;
export class Signup extends Component {
	constructor(props){
		super(props);
		this.state = {
			signup : true
		};
	}
	setup(p5, canvasParentRef) {
        p5.noCanvas();
        video = p5.createCapture(p5.VIDEO);
        const v = document.querySelector("video");
        let st = "position: absolute; top: 255px;"
        v.setAttribute("style", st);
    }

    setup2 = async () => {
          const mood = document.getElementById('mood').value;
          video.loadPixels();
          console.log(video.canvas);
          const image64 = video.canvas.toDataURL();
          const data = { mood, image64 };
          const options = {
            method: 'POST',
            headers: {
              'Content-Type': 'application/json'
            },
            body: JSON.stringify(data)
          };
          console.log(image64);
          const response = await axios.post('http://localhost:5000/register', {'image64':image64, 'username':mood});
          if(response.status==200){
		  		const tracks = document.querySelector("video").srcObject.getTracks();
		  		tracks.forEach(function(track) {
    				track.stop();
  				});
		  	};
    }
    

	render(){

		console.log("this component")

		let signup = (
				<div>
					<nav class="navbar navbar-expand-lg navbar-light bg-white py-3 shadow-sm">
						<div id="navbarContent" class="collapse navbar-collapse">
							<ul class="navbar-nav mx-auto">
								<li class="nav-item"><a href="/" class="nav-link font-weight-bold text-uppercase">CAPTURE</a></li>
								<li class="nav-item"><a href="/logs" class="nav-link font-weight-bold text-uppercase">LOGS</a></li>
								<li class="nav-item"><a href="/database" class="nav-link font-weight-bold text-uppercase">DATABASE</a></li>
							</ul>
						</div>
					</nav>
					<div className="limiter">
						<div className="container-login100">
							<div className="wrap-login100 p-l-110 p-r-110 p-t-62 p-b-33">
									<span className="login100-form-title p-b-53">
										Sign Up With
									</span>
									<div className="p-t-31 p-b-9">
										<span className="txt1">
											Username
										</span>
									</div>
									<div className="wrap-input100 validate-input" data-validate = "Username is required">
										<input id="mood" className="input100" type="text" name="username" />
										<span className="focus-input100"></span>
									</div>
									<input/>
									<br/><br/>
									<br/><br/>
									<br/><br/>
									<br/><br/>
									<br/><br/>
									<br/><br/>
									<br/><br/>

									{this.state.signup?<Sketch id="s" setup={this.setup} draw={this.draw}/>:''}
									
									<div className="container-login100-form-btn m-t-17">
										<button id="submit" onClick={this.setup2} className="login100-form-btn">
											Sign Up
										</button>
									</div>
									<div className="container-login100-form-btn m-t-17">
										<Link to="/" className="login100-form-btn">
											Capture
										</Link>
									</div>						
							</div>
						</div>
					</div>
					<div id="dropDownSelect1"></div>
				</div>
		)
    	return (<div >
    		{ signup }
    		</div>
		)
	}
}
export default Signup;
